export enum QuestionTypes {
    textInput = "textInput",
    numberInput = "numberInput",
    radio = "radio",
    select = "select",
    multiple = "multiple",
    date = "date",
    email = "email"
}

export interface IRadioFieldType{
    label: string;
    value: string
}

export interface IQuestion {
    question: string;
    fieldName: string;
    currentValue?: string | string[] | IRadioFieldType[] | number;
    type: QuestionTypes;
    inputLabel?: string;
    multiple?: Omit<IQuestion, "question">[];
    rules?: any;
}

export type IQuestionInitialState = {
    questions: IQuestion[];
    answers: string[];
};
